import React from 'react';
import "./style.css";
import re1 from "./images/re1.png"

const Resturant = () => {
    return (
        <>
           <div className="sec1">
                <div className="sec2">
                    <img src= {re1} alt="Not Loading"/>

                </div>
           </div>
        </>
    )
}

export default Resturant;
